import { useContext } from "react"
import { Accordion } from "react-bootstrap";
import { AcordianProvider } from "../MainAcordian";

function LeftAcordian(props) {
    const context = useContext(AcordianProvider)
    console.log(context);
    const finding = context.state.states.filter((item) => {
        return item.id === props.value.item.id;
    });
    return (
        <div>
            <Accordion defaultActiveKey={props.value.item.id}>
                <Accordion.Item eventKey={props.value.item.id}>
                    <Accordion.Header>{props.value.item.cName}</Accordion.Header>
                    <Accordion.Body>
                        <ul>
                            {finding.map((item) => {
                                return <li>{item.sName}</li>
                            })}
                        </ul>
                    </Accordion.Body>
                </Accordion.Item>
            </Accordion>
        </div>
    )
}
export default LeftAcordian
